The credentials library will be updated to change the proto spec for the Credential message. message Credential { bytes node_id = 1; // 20 bytes representing the Node address int64 timestamp = 2; // UTC epoch time the credential was issued
} will change to enum OperatorType { OT_ROCKETPOOL = 0; // Issued to a RP NO via a signature from their node wallet. OT_SOLO = 1; // Issued to a solo validator via a signature from their 0x01 withdrawal address.
} message Credential { bytes address = 1; // 20 bytes representing the Node address, or if a solo validator, the withdrawal adress. int64 timestamp = 2; // UTC epoch time the credential was issued. OperatorType operator_type = 3; // The type of Node Operator for whom the credential was issued.
} These messages are used across the stack to identify the user for whom we process traffic, and critically, rate-limit their access.
